CREATE TABLE IF NOT EXISTS passengers (
    passenger_id VARCHAR(50),
    full_name VARCHAR(100),
    passport_number VARCHAR(20),
    email VARCHAR(100),
    phone VARCHAR(20),
    date_of_birth DATE,
    nationality VARCHAR(50),
    flight_code VARCHAR(10),
    seat_number VARCHAR(10),
    check_in_status VARCHAR(30)
);

CREATE TABLE IF NOT EXISTS flights (
    flight_code VARCHAR(10),
    departure_airport VARCHAR(100),
    arrival_airport VARCHAR(100),
    departure_time DATETIME,
    arrival_time DATETIME,
    gate_number VARCHAR(10),
    aircraft_model VARCHAR(50),
    status VARCHAR(20),
    pilot_in_command VARCHAR(100),
    co_pilot_name VARCHAR(100)
);

CREATE TABLE IF NOT EXISTS baggage (
    baggage_id VARCHAR(50),
    passenger_id VARCHAR(50),
    weight DECIMAL(5,2),
    destination VARCHAR(100),
    barcode VARCHAR(50),
    status TEXT,
    scanned_by VARCHAR(100),
    entry_point VARCHAR(50),
    exit_point VARCHAR(50),
    handling_agent VARCHAR(100)
);

CREATE TABLE IF NOT EXISTS clearance_logs (
    id VARCHAR(50),
    passenger_id VARCHAR(50),
    security_officer VARCHAR(100),
    entry_time DATETIME,
    exit_time DATETIME,
    terminal VARCHAR(10),
    flagged VARCHAR(10),
    reason TEXT,
    resolution TEXT,
    notes TEXT
);

CREATE TABLE IF NOT EXISTS wifi_logs (
    device_id VARCHAR(50),
    passenger_email VARCHAR(100),
    mac_address VARCHAR(50),
    session_start DATETIME,
    session_end DATETIME,
    bandwidth_used VARCHAR(20),
    ip_address VARCHAR(50),
    device_type VARCHAR(50),
    login_status VARCHAR(20),
    terms_agreed VARCHAR(10)
);

ALTER TABLE customers ADD COLUMN profile_pic VARCHAR(255) DEFAULT NULL;

